import React from 'react';
import './Header.css';
import './selfie.jpg';

function Name() {
    return (
        <div className="Name">
            <h1>Bradley Collins Maness</h1>
        </div>
    );
}

function Portrait() {
    return (
        <img  className="selfie" src="./selfie.jpg"></img>
    );
}

export default Name
